import React from 'react';



export function listing() {

    const response = fetch('https://api.pokemontcg.io/v1/cards');

    return response.json();

};

export function search(value) {

    const newUrl = `https://api.pokemontcg.io/v1/cards/?name=${value}`;

    fetch(newUrl)
        .then(response => {
            if (!response.ok) {
                throw new Error();
            }
            return response.json();
        });

}
